                <div className="col-8">
                    <p className="text-center">Common Cents Collaborative 
                        ("Common Cents") is not a financial advisor, investment advisor, 
                        legal advisor, accountant, or other certified financial professional. 
                        All opinions expressed by Common Cents Collaborative are intended for 
                        informational purposes and should not be viewed as legal or financial 
                        advice.
                    </p>
                    <p className="text-center">{ copyRight}</p>
                </div>
            </div>
        </footer>
    );
}
